import React, { Component } from "react";
import NavBar from "./Components/navbar";
import "./App.css";
<link
  rel="stylesheet"
  href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"
/>;

class App extends Component {
  render() {
    return <NavBar />;
  }
}

export default App;
